import React from 'react';
import './style.css';
import './function.js';
import { useNavigate } from 'react-router-dom';


const LoginFaculty = () => {
    let navigate = useNavigate()

    return (<>
    
    <div class="login-box">
  <h2>Login</h2>
  <form>
    <div class="user-box">
      <input type="mail" name="" className='rounded pt-4' required=""/>
      <label className='my-3'>Mail Id</label>
    </div>
    <div class="user-box">
      <input type="password" name="" className='rounded pt-4' required=""/>
      <label className='my-3'>Password</label>
    </div>
    <div className='text-center' onClick={()=>{navigate("/faculty/signup")}}>CLICK HERE FOR SIGNUP</div>
    <a href="#" className=''>        
      Login
    </a>
  </form>
</div>
    </>);
}

export default LoginFaculty;
